import React from "react";
import Slider from "react-slick";
import "./CardSlider.css"; // Crie este arquivo para o CSS

// Ícones ou nomes das tecnologias para os cards
const techStack = [
    "React",
    "JavaScript",
    "HTML",
    "CSS",
    "Git",
    "Node.js"
];


const CardSlider = () => {
    var settings = {
        dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    };    
    

    return (
        <div className="slider-container">
            <div className="fade-left"></div>
            <Slider {...settings}>
                {techStack.map((tech, index) => (
                    <div key={index} className="card">
                      <h3>{tech}</h3> {/* Exibindo o nome da tecnologia */}
                    </div>
                ))}
            </Slider>

            <div className="fade-right"></div>
        </div>
    );
};

export default CardSlider;
